import React from 'react';
import '../styles/Inscription.css';
import { useState } from 'react';

function Inscription(){

    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [dateNaissance, setDateNaissance] = useState('');
    const [password, setPassword] = useState('');
    const [password2, setPassword2] = useState('');

    const onSubmit = (e) => {
        e.preventDefault();
        const form = e.currentTarget;
        const name = form.elements.name.value;

        alert(`Submitted Name: ${name}`);
    };

    return (<div> 
        <h1>Formulaire d'inscription</h1>
        <form>
        <label htmlFor="fname"><big> Name : </big></label>

        <div> <input value={name} onChange={(e) => setName(e.target.value)} placeholder="Votre nom et prenom.." /> 
        </div> 
        <input value={email} onChange={(e) => setEmail(e.target.value)} />
        <input value={dateNaissance} onChange={(e) => setDateNaissance(e.target.value)} />
        <input value={password} onChange={(e) => setPassword(e.target.value)} />
        <input value={password2} onChange={(e) => setPassword2(e.target.value)} />
        <button type="submit">Submit</button>
        </form>

    </div>
    );
}

export default Inscription;
